import React, { useState, useEffect } from "react";

export default function SingleBuyOrder(props) {
	const [buyOrderDetails, setBuyOrderDetails] = useState(props.order);

	return (
		<tr>
			<td>
				{typeof buyOrderDetails != "undefined"
					? buyOrderDetails.tokensLeftToBuy / 10 ** 18
					: null}
			</td>
			<td style={{ color: "#55bd6c" }}>
				{typeof buyOrderDetails != "undefined"
					? buyOrderDetails.buyPrice / 10 ** 18
					: null}
			</td>
		</tr>
	);
}
